var barWithEasing = function() {
    // initial setup --> connect audio
    var audioCtx = new (window.AudioContext || window.webkitAudioContext)();
    var myAudio = document.querySelector('audio');
    var source;
    var audioCtx = new AudioContext();
    var analyser = audioCtx.createAnalyser();
    analyser.fftSize = 1024;
    analyser.minDecibels = -90;
    analyser.maxDecibels = -10;
    analyser.smoothingTimeConstant = 0;
    // setup --> data
    var bufferLength = analyser.frequencyBinCount;
    // var bufferLength = analyser.fftSize;
    var drawVisual;
    var dataArray = new Uint8Array(bufferLength);
    source = audioCtx.createMediaElementSource(myAudio);
    source.connect(analyser);
    // setup --> canvas
    var canvas = document.getElementById('myCanvas');
    var canvasCtx = canvas.getContext('2d');
    var drawVisual;
    WIDTH = canvas.width;
    HEIGHT = canvas.height;
    canvasCtx.fillStyle = '#FFF';
    canvasCtx.fillRect(0, 0, WIDTH, HEIGHT);
    // canvasCtx.clearRect(0, 0, WIDTH, HEIGHT);
    var gradient = canvasCtx.createLinearGradient(0,0,0,300);
    gradient.addColorStop(1,'#000000');
    gradient.addColorStop(0.75,'#ff0000');
    gradient.addColorStop(0.25,'#ffff00');
    gradient.addColorStop(0,'#ffffff');
    barWidth = WIDTH / bufferLength;

    var iteration = 0;
    var totalIterations = 20;
    var easingValue;

    draw = function() {
        canvasCtx.clearRect(0, 0, WIDTH, HEIGHT);
        easingValue = easeOutQuart(iteration, 250, -300, totalIterations);
        easingValueHeight = easeOutQuint(iteration, 0, 10, totalIterations);
        easingValueWidth = easeOutQuint(iteration, 20, 12, totalIterations);
        analyser.getByteFrequencyData(dataArray);

        var bars = [];
        var frequencyCount = 0;
        var bassSum = 0;
        var baritoneSum = 0;
        var tenorSum = 0;
        var contraltoSum = 0;
        var sopranoSum = 0;
        var freq = 0;
        for(var i = 0; i < dataArray.length; i++) {
          freq = dataArray[i];
          if(0 < frequencyCount && frequencyCount < 100) bassSum += (dataArray[i]-128);
          if(99 < frequencyCount && frequencyCount < 200) baritoneSum += (dataArray[i]-128);
          if(199 < frequencyCount && frequencyCount < 300) tenorSum += (dataArray[i]-128);
          if(299 < frequencyCount && frequencyCount < 500) contraltoSum += (dataArray[i]-128);
          if(499 < frequencyCount && frequencyCount < 1200) sopranoSum += (dataArray[i]-128);
          frequencyCount += 43;
        }
        // for(var i = 0; i < dataArray.length; i++) {
        //   freq = dataArray[i];
        //   if(87 < frequencyCount && frequencyCount < 349) bassSum += (dataArray[i]-128);
        //   if(98 < frequencyCount && frequencyCount < 392) baritoneSum += (dataArray[i]-128);
        //   if(130 < frequencyCount && frequencyCount < 494) tenorSum += (dataArray[i]-128);
        //   if(131 < frequencyCount && frequencyCount < 698) contraltoSum += (dataArray[i]-128);
        //   if(247 < frequencyCount && frequencyCount < 1175) sopranoSum += (dataArray[i]-128);
        //   frequencyCount += 43;
        // }
        // var sum = 0;
        // for(var i = 0; i < dataArray.length; i++) {
        //   sum += dataArray[i];
        // }
        // var volume = sum / bufferLength;
        // console.log('bassSum = ' + bassSum);
        // console.log('baritoneSum = ' + baritoneSum);
        // console.log('tenorSum = ' + tenorSum);
        // console.log('contraltoSum = ' + contraltoSum);
        // console.log('sopranoSum = ' + sopranoSum);

        var bass = [bassSum*0.3, bassSum*0.55, bassSum, bassSum*0.9, bassSum*0.68, bassSum*0.4];
        var baritone = [baritoneSum*0.3, baritoneSum*0.55, baritoneSum, baritoneSum*0.9, baritoneSum*0.68, baritoneSum*0.4];
        var tenor = [tenorSum*0.3, tenorSum*0.55, tenorSum, tenorSum*0.9, tenorSum*0.68, tenorSum*0.4];
        var contralto = [contraltoSum*0.3, contraltoSum*0.55, contraltoSum, contraltoSum*0.9, contraltoSum*0.68, contraltoSum*0.4];
        var soprano = [sopranoSum*0.3, sopranoSum*0.55, sopranoSum, sopranoSum*0.9, sopranoSum*0.68, sopranoSum*0.4];
        canvasCtx.fillStyle = gradient;
        for (var i = 0; i < bass.length; i++) {
          canvasCtx.fillRect(i*12, HEIGHT, 10, -bass[i] - 100)
        }
        // canvasCtx.fillStyle = '#000';
        for (var i = 0; i < baritone.length; i++) {
          canvasCtx.fillRect((i+5)*12, HEIGHT, 10, -baritone[i] - 50)
        }
        // canvasCtx.fillStyle = '#AAA';
        for (var i = 0; i < tenor.length; i++) {
          canvasCtx.fillRect((i+10)*12, HEIGHT, 10, -tenor[i])
        }
        // canvasCtx.fillStyle = 'green';
        for (var i = 0; i < contralto.length; i++) {
          canvasCtx.fillRect((i+15)*12, HEIGHT, 10, -contralto[i])
        }
        // canvasCtx.fillStyle = 'blue';
        for (var i = 0; i < soprano.length; i++) {
          canvasCtx.fillRect((i+20)*12, HEIGHT, 10, -soprano[i] - 50)
        }
        // canvasCtx.fillStyle = gradient;
        // for (var i = 0; i < bars.length; i++) {
        //   // canvasCtx.fillRect(easingValue + 30*i, HEIGHT - 10, easingValueWidth, -bars[i]*easingValueHeight);
        //   // canvasCtx.fillRect(125 - easingValue, easingValue + 10*i, -bars[i]*100, 5);
        //   canvasCtx.fillRect(i*12, HEIGHT - 10, 10, -bars[i])
        // }
        // canvasCtx.fillRect(12, HEIGHT - 10, 10, -volume)
        if(iteration < totalIterations) {
          iteration++;
        } else {
          iteration = 0;
        }
        requestAnimationFrame(draw);
    }
    draw();
    source.connect(audioCtx.destination);
}

