var practice = function() {
  var canvas = document.getElementById('canvas');
  var context = canvas.getContext('2d');
  WIDTH = canvas.width;
  HEIGHT = canvas.height;


  //////// DRAW GRID /////////

  // context.moveTo => start from where
  // context.lineTo => draw line to where
  //// moveTo and lineTo are both PENCIL methods, NEED stroke to INK them in
  for (var x = 0.5; x < 500; x += 10) {
      context.moveTo(x, 0);
      context.lineTo(x, 375);
  }

  for (var y = 0.5; y < 375; y += 10) {
    context.moveTo(0, y);
    context.lineTo(500, y);
  }

  context.strokeStyle = "#eee";
  context.stroke();
  //////// END OF GRID /////////

  //////// DRAW ARROWS /////////
  // x axis
  context.beginPath();
  context.moveTo(0, 40);
  context.lineTo(240, 40);
  context.moveTo(260, 40);
  context.lineTo(500, 40);
  context.moveTo(495, 35);
  context.lineTo(500, 40);
  context.lineTo(495, 45);
  // we dont need a new path for 2nd axis so just reuse it
  // y axis
  context.moveTo(60, 0);
  context.lineTo(60, 153);
  context.moveTo(60, 173);
  context.lineTo(60, 375);
  context.moveTo(65, 370);
  context.lineTo(60, 375);
  context.lineTo(55, 370);

  context.strokeStyle = "#000";
  context.stroke();
  //////// END OF ARROWS /////////

  //////// START OF TEXT /////////
  context.font = "bold 12px sans-serif";

  // fillText draws the actual text
  context.fillText('x', 248, 43);
  context.fillText('y', 58, 165);

  //////// END OF TEXT /////////

  //////// START OF GRADIENT /////////
  var my_gradient = context.createLinearGradient(0, 0, 300, 0);
  my_gradient.addColorStop(0, "black");
  my_gradient.addColorStop(1, "white");

  //////// END OF GRADIENT /////////
}

